import cseImage from "public/Images/branch images/cse.png";
import eceImage from "./Images/branch images/ece.jpg";
import eeeImage from "./Images/branch images/eee.png";
import mechImage from "./Images/branch images/mech.jpg";
import ceImage from "./Images/branch images/civil.jpg";
import chImage from "./Images/branch images/chemical.jpg";

export const coursesData = [
  {
    title: "CSE",
    description: "Computer Science and Engineering: Innovating technology, solving problems, shaping the future.",
    image: require('./')
  },
  {
    title: "ECE",
    description: "Innovates communication systems, electronic technologies for global connectivity.",
    image: eceImage,
  },
  {
    title: "EEE",
    description: "Electrical and Electronic Engineering innovates technology with electrical systems, devices.",
    image: eeeImage,
  },
  {
    title: "MECH",
    description: "Mechanical Engineering Innovating machines, systems, and technologies for diverse applications.",
    image: mechImage,
  },
  {
    title: "CE",
    description: "Civil Engineering designs and constructs infrastructure, shaping the built environment.",
    image: ceImage,
  },
  {
    title: "CH",
    description: "Chemical engineering involves applying principles to design and optimize processes.",
    image: chImage,
  },
];
